import React from "react";
import SectionTitle from "../../components/SectionTitle";

function About() {
  return (
    <div>
      <SectionTitle title="About" />

      <div className="flex">
        <div className="h-[5vh]">
          <dotlottie-player
            src="https://lottie.host/fc447921-f407-4458-a225-d3ee5986e359/yYyhRWFEOq.json"
            background="transparent"
            speed="1"
            style="width: 300px; height: 300px"
            direction="1"
            playMode="normal"
            loop
            controls
            autoplay
          ></dotlottie-player>
        </div>
      </div>
    </div>
  );
}

export default About;
